import ItemBg from "../../components/ItemBg/ItemBg"

const GelCatalog = ({ list, title }) => {
  document.title = `Рентгенология ${title} | Сенатмед`
  return (
    <>
      <ItemBg title={`Аппараты ${title}`} />
    </>
  )
}

export default GelCatalog
